/* Custom filtering function which will search data in column four between two values */
$.fn.dataTable.ext.search.push(
  function( settings, data, dataIndex ) {
            var intVal = function ( i ) {
                return typeof i === 'string' ?
                    i.replace(/[\$,]/g, '')*1 :
                    typeof i === 'number' ?
                        i : 0;
            };
    
    var minAge = parseInt( $('#minAge').val(), 10 );
    var maxAge = parseInt( $('#maxAge').val(), 10 );
    // var age = parseFloat( data[3] ) || 0; // use data for the age column
    var age = intVal( data[3] ) || 0; // use data for the age column
    var ageFound = false;  // Is the age within the range
    
    if ( ( isNaN( minAge ) && isNaN( maxAge ) ) ||
        ( isNaN( minAge ) && age <= maxAge ) ||
        ( minAge <= age   && isNaN( maxAge ) ) ||
        ( minAge <= age   && age <= maxAge ) )
    {
      ageFound = true;
    }
    //return false;
    
    
    var minSalary = parseInt( $('#minSalary').val(), 10 );
    var maxSalary = parseInt( $('#maxSalary').val(), 10 );
    var salary = intVal( data[4] ) || 0; // use data for the age column
    var salaryFound = false;  // Is the salary within the range

    if ( ( isNaN( minSalary ) && isNaN( maxSalary ) ) ||
        ( isNaN( minSalary ) && salary <= maxSalary ) ||
        ( minSalary <= salary   && isNaN( maxSalary ) ) ||
        ( minSalary <= salary   && salary <= maxSalary ) )
    {
      salaryFound = true;
    }

    // Show row if all are within range (all are true) otherwise hide row
    return ageFound && salaryFound;  
  }
);

